import React, { useState } from "react";
import DatePicker from 'react-datepicker';
import axios from "axios";
import "react-datepicker/dist/react-datepicker.css";

export default function Registro() {
    const [values, setValues] = useState({
        contrasenia: '',
        correo: '',
        apellido: '',
        nombre: '',
        dni: '',
        fecha_nacimiento: '',
    })
    const navigate = useNavigate();

    const [errors, setErrors] = useState({});

    const handleInput = (event) => {
        setValues(prev => ({ ...prev, [event.target.name]: [event.target.value] }))
    }
    const handleSubmit = (event) => {
        event.preventDefault();
        const validationErrors = Validation(values);
        if (Object.keys(validationErrors).length === 0) {
            // No hay errores de validación, enviar la solicitud al servidor
            axios.post("http://localhost:8081/signup", values)
                .then((res) => {
                    navigate('/');
                })
                .catch((err) => console.log(err));
        } else {
            // Hay errores de validación, establecerlos en el estado
            setErrors(validationErrors);
        }
    };
    return (
        <div className='d-flex justify-content-center align-items-center bg-primary vh-100'>
            <div className='bg-white p-3 rounded w-25'>
                <h2>Sign-Up</h2>
                <form action="" onSubmit={handleSubmit}>
                    <div className='mb-3'>
                        <label htmlFor="contrasenia"><strong>Contraseña</strong></label>
                        <input type="password" placeholder='Ingrese su contraseña' id='contrasenia' name='contrasenia' onChange={handleInput} className='form-control rounded-0' />
                        {errors.contrasenia && <span className='text-danger'> {errors.contrasenia} </span>}
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="correo"><strong>Correo</strong></label>
                        <input type="text" placeholder='Ingrese su correo' id='correo' name='correo' onChange={handleInput} className='form-control rounded-0' />
                        {errors.correo && <span className='text-danger'> {errors.correo} </span>}
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="apellido"><strong>Apellido</strong></label>
                        <input type="text" placeholder='Ingrese su apellido' id='apellido' name='apellido' onChange={handleInput} className='form-control rounded-0' />
                        {errors.apellido && <span className='text-danger'> {errors.apellido} </span>}
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="nombre"><strong>Nombre</strong></label>
                        <input type="text" placeholder='Ingrese su nombre' id='nombre' name='nombre' onChange={handleInput} className='form-control rounded-0' />
                        {errors.nombre && <span className='text-danger'> {errors.nombre} </span>}
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="dni"><strong>DNI</strong></label>
                        <input type="text" placeholder='Ingrese su dni' id='dni' name='dni' onChange={handleInput} className='form-control rounded-0' />
                        {errors.dni && <span className='text-danger'> {errors.dni} </span>}
                    </div>
                    <div className='mb-3'>
                        <label htmlFor="fecha_nacimiento"><strong>Fecha de Nacimiento</strong></label>
                        <input type="text" placeholder='Ingrese su fecha de nacimiento' id='fecha_nacimiento' name='fecha_nacimiento' onChange={handleInput} className='form-control rounded-0' />
                        {errors.fecha_nacimiento && <span className='text-danger'> {errors.fecha_nacimiento} </span>}
                    </div>
                    <button type='submit' className='btn btn-success w-100 rounded-0'>Crear Cuenta</button>
                    <p>Estás de acuerdo con nuestros términos y condiciones</p>
                    <Link to="/" className='btn-default border w-100 bg-light rounded-0 text-decoration-none'>Login</Link>
                </form>
            </div>
        </div>
    )
}
